import "../../../css/Admin/statistics.css";
import React, { useState, useEffect } from 'react';

export function Statistics() {

    const [users, setUsers] = useState([])

    useEffect(() => {
        const obtenerEstadisticas = async () => {
            const fechaInicio = '2023-01-01'; // Aquí deberías poner tu lógica para obtener la fecha de inicio
            const fechaFin = '2023-12-31'; // Aquí deberías poner tu lógica para obtener la fecha de fin
        
            try {
                const response = await fetch(`http://localhost:3001/getStatistics?fechaInicio=${encodeURIComponent(fechaInicio)}&fechaFin=${encodeURIComponent(fechaFin)}`);
                if (!response.ok) {
                    throw new Error(`HTTP error! Status: ${response.status}`);
                }
        
                const data = await response.json();
                console.log(data);
            } catch (error) {
                console.error('Error al obtener estadísticas:', error);
            }
        };
    }, []);

    return(
        <>
             <div className="title-box-crud">
                <h2>Estadísticas</h2>
            </div>
            <div className="estatistics-box">
                <div className="info-statistics">
                    <h3 className="txt-blue">Cantidad de reservas hasta hoy:</h3>
                    <h1 className="txt-black">1000</h1>
                </div>
                <div className="info-statistics">
                    <h3 className="txt-blue">Cantidad de reservas de este mes:</h3>
                </div>
                <div className="info-statistics">
                    <h3 className="txt-blue">Cantidad de usuarios activos:</h3>
                </div>
                <div className="info-statistics">
                    <h3 className="txt-blue">Asesor con más reservas:</h3>
                </div>
            </div>
        </>
    )
}
